	const renderedTasks = completedTasks.map((task) => {
		return (
			<TaskCard
				// handleComplete={handleComplete}
				task={task}
				key={task.id}
			/>
		);
	});

	return <>{completedTasks}</>;
};

export default CompletedTaskContainer;
